#define NUM_DATA 506
class LCM_PIDTracker_Handler {
    public:
        lcm::LCM lcm_ptr;   bool running;	bool torque_mode;
        LCM_PIDTracker_Handler(bool use_torques) : torque_mode(use_torques) {running = 0;    if(!lcm_ptr.good()){printf("LCM Failed to Init in PIDTracker\n");}}
        ~LCM_PIDTracker_Handler(){}

        // lcm callback function to update the initial t0
        void handleMessage(const lcm::ReceiveBuffer *rbuf, const std::string &chan, const drake::lcmt_iiwa_status *msg){
            if(!running){running = 1;    runTracker(msg->utime);}
        }

        // do tracking
        void runTracker(int64_t t0){
            struct timeval start, end; gettimeofday(&start,NULL); int counter = 0;
            printf("Tracker running with t0[%ld]\n",t0);
            while(counter < NUM_DATA){
                double tk = t0 + counter*1000;    double *qk = &qData[counter*NUM_POS];  double *uk = &uData[counter*CONTROL_SIZE];	counter++;
                #if HARDWARE_MODE
                	drake::lcmt_iiwa_command_hardware dataOut;
                	#pragma unroll
	                for(int i=0; i < 6; i++){dataOut.wrench[i] = 0.0;}
	            #else
	                drake::lcmt_iiwa_command dataOut;   
	                dataOut.num_torques = static_cast<int32_t>(CONTROL_SIZE);
	            #endif
	            dataOut.num_joints = static_cast<int32_t>(NUM_POS);         dataOut.joint_position.resize(dataOut.num_joints);
	            dataOut.utime = tk;           								dataOut.joint_torque.resize(dataOut.num_joints);  // NUM_POS = CONTROL_SIZE for arm so this works
                // send torques and positions -- zero not used values
                #pragma unroll
                for (int i = 0; i < CONTROL_SIZE; i++){dataOut.joint_torque[i] = torque_mode ? uk[i] : 0.0;}
                #pragma unroll
                for (int i = 0; i < NUM_POS; i++){dataOut.joint_position[i] = qk[i];}
                printf("Time[%d][%ld] qk[%f %f %f %f %f %f %f] uk[%f %f %f %f %f %f %f]\n",counter,dataOut.utime,
                					dataOut.joint_position[0],dataOut.joint_position[1],dataOut.joint_position[2],
                					dataOut.joint_position[3],dataOut.joint_position[4],dataOut.joint_position[5],
                					dataOut.joint_position[6],dataOut.joint_torque[0],dataOut.joint_torque[1],dataOut.joint_torque[2],
                					dataOut.joint_torque[3],dataOut.joint_torque[4],dataOut.joint_torque[5],dataOut.joint_torque[6]);
                lcm_ptr.publish(ARM_COMMAND_CHANNEL,&dataOut);
                // wait for 1 ms
                while(1){gettimeofday(&end,NULL);    if (time_delta_ms(start,end) >= 1.0){gettimeofday(&start,NULL); break;}}
            }
        }
};


__host__
void runPIDTracker(bool torque_mode = 0){
    lcm::LCM lcm_ptr;   if(!lcm_ptr.good()){printf("LCM Failed to Init in PIDTracker\n");}
    LCM_PIDTracker_Handler handler = LCM_PIDTracker_Handler(torque_mode);
    lcm::Subscription *sub = lcm_ptr.subscribe(ARM_STATUS_CHANNEL, &LCM_PIDTracker_Handler::handleMessage, &handler);
    sub->setQueueCapacity(1);
    while(0 == lcm_ptr.handle());
}

int main(int argc, char *argv[])
{
    printf("Position Control Mode [0] or Torque Control Mode [1]\n");
    runPIDTracker(getInt(1,0) == 1);
}
